script: |
  super -f tsv -I q9533.sql | sort > q9533.out

vector: true

inputs:
  - name: q9533.sql
    data: |
      pragma pg
      SELECT + 88 AS col2 FROM tab2 AS cor0 GROUP BY col1, col2 HAVING NOT ( + CAST ( + col2 AS INTEGER ) ) IS NULL;
  - name: tab2

outputs:
  - name: q9533.out
    data: |
      88
      88
      88
